ate','App\\Models\\PageElement',85,'App\\Models\\PageElement',85,'App\\Models\\PageElement',85,'','finished','','2019-10-14 11:33:23','2019-10-14 11:33:23',NULL,'{\"seq\":\"1\",\"title\":\"Hoe het werkt!\",\"content\":\"<div>Een particuliere financiering is te vergelijken met Financial Lease. Je betaald per maand een vast bedrag en uiteindelijk wordt de auto eigendom, Je bent dan zowel economisch als juridisch eigenaar.&nbsp; Het is te vergelijken met een hypotheek alleen dient hierbij de auto als onderpand. Hoeveel er per maand wordt afgelost is afhankelijk van de auto en de looptijd van de financiering.&nbsp;<br><br><\\/div>\",\"page_id\":1013,\"updated_at\":\"2019-10-14 13:33:23\",\"created_at\":\"2019-10-14 13:33:23\",\"id\":85}'),(640,'8ee2ecaa-921c-4a25-90d9-e9348be5530a',40,'Create','App\\Models\\PageElement',86,'App\\Models\\PageElement',86,'App\\Models\\PageElement',86,'','finished','','2019-10-14 11:34:03','2019-10-14 11:34:03',NULL,'{\"seq\":\"2\",\"title\":\"De voordelen \",\"content\":\"<div>Een particuliere financiering heeft veel voordelen, we zetten ze voor je op een rij:&nbsp;<\\/div><ul><li>&nbsp;De auto wordt volledig eigendom<\\/li><li>Zowel nieuwe auto\\u2019s als occasions zijn mogelijk&nbsp;<\\/li><li>Je bepaalt zelf de looptijd van de financiering&nbsp;<\\/li><li>&nbsp;Je behoudt je schade vrije jaren (en bouwt deze verder op)&nbsp;<\\/li><li>Je kunt zelf bepalen waar je de auto brengt voor onderhoud&nbsp;<\\/li><\\/ul><div><br><\\/div>\",\"page_id\":1013,\"updated_at\":\"2019-10-14 13:34:03\",\"created_at\":\"2019-10-14 13:34:03\",\"id\":86}'),(641,'8ee2ecd4-793b-4a12-b5c7-2c07eecc87fc',40,'Create','App\\Models\\PageElement',87,'App\\Models\\PageElement',87,'App\\Models\\PageElement',87,'','finished','','2019-10-14 11:34:31','2019-10-14 11:34:31',NULL,'{\"seq\":\"3\",\"title\":\"Waarom kiezen voor Lease.auto? \",\"content\":\"<div>Bij Lease.auto kun je terecht voor alle leasevormen en financieringen. Hierdoor kunnen onze adviseurs je altijd 