Naast Private Lease biedt Lease.auto voor particulieren ook een particuliere financiering aan, dit wordt ook wel een consumptief krediet of consumptieve financiering genoemd. Hierbij wordt de auto maandelijks afbetaald en uiteindelijk volledig eigendom.<br><br><\\/div>\"}'),(650,'8ef31bd3-d782-45b8-a08b-9ab8fb0972cc',40,'Create','App\\Models\\Page',1014,'App\\Models\\Page',1014,'App\\Models\\Page',1014,'','finished','','2019-10-22 12:39:10','2019-10-22 12:39:10',NULL,'{\"title\":\"Winterbanden wisselen; Wat is het nut?       \",\"slug\":\"Winterbanden-wisselen-Wat-is-het-nut?       \",\"description\":\"Winterbanden wisselen; Wat is het nut?       \",\"template\":\"blog\",\"content\":\"<div>Met de winter op komst vragen veel mensen zich af hoe belangrijk winterbanden zijn en wanneer ze het beste gewisseld kunnen worden. Alles over winterbanden lees je in deze blog!&nbsp;<\\/div>\",\"created_by\":40,\"id\":1014}'),(651,'8ef31c4e-f818-46cd-97fb-2d8905c61863',40,'Create','App\\Models\\PageElement',89,'App\\Models\\PageElement',89,'App\\Models\\PageElement',89,'','finished','','2019-10-22 12:40:31','2019-10-22 12:40:31',NULL,'{\"seq\":\"1\",\"title\":\"Over winterbanden \",\"content\":\"<div>Goede banden zijn essentieel, dat weten de meeste automobilisten. Dat winterbanden ook in Nederland van belang zijn is vaak minder bekend. Ondanks de vlakke wegen en milde winters blijven winterbanden belangrijk. Het verschil tussen zomer- en winterbanden zit in de samenstelling van het rubber en het profiel van de banden. Dit zorgt ervoor dat de auto meer grip heeft. Ook in Nederland kunnen winterbanden het verschil maken.&nbsp;<\\/div>\",\"page_id\":1014,\"updated_at\":\"2019-10-22 14:40:31\",\"created_at\":\"2019-10-22 14:40:31\",\"id\":89}'),(652,'8ef31cb1-0d6b-4143-9354-d264fe8825d4',40,'Create','App\\Models\\PageElement',90,'App\\Models\\PageElement',90,'App\\Models\\PageElement',90,'','finished','','2019-10-22 12:41:35','2019-10-22 12:41:35',NULL,'{\"seq\":\"2\",\"title\":\"Winterbanden in de zomer\",\"content\":\"<div>Veel weggebruikers vergeten hun banden na de winter om te wisselen en rijden door op de winterbanden. Ze weten niet dat dit gevaarlijke situaties op kan leveren. Zo heb je met winterbanden een langere remweg in de zomer dan met zomerbanden. Hiernaast is ook de wegligging van winterbanden in de zomer&nbsp; slechter. Je moet je rijdgedrag aanpassen wanneer je doorrijdt met winterbanden door het vergroten van de volgafstand en het verlagen van de snelheid. Ook slijten de winterbanden sneller in de zomer.<\\/div>\",\"page_id\":1014,\"updated_at\":\"2019-10-22 14:41:35\",\"created_at\":\"2019-10-22 14:41:35\",\"id\":90}'),(653,'8ef31d02-b37f-4dfc-a746-d43f755f467e',40,'Update','App\\Models\\Page',1014,'App\\Models\\Page',1014,'App\\Models\\Page',1014,'','finished','','2019-10-22 12:42:29','2019-10-22 12:42:29','{\"title\":\"Winterbanden wisselen; Wat is het nut?       \",\"slug\":\"Winterbanden-wisselen-Wat-is-het-nut?       \",\"description\":\"Winterbanden wisselen; Wat is het nut?       \"}','{\"title\":\"Winterbanden wisselen; hoe belangrijk is het?\",\"slug\":\"Winterbanden-wisselen-hoe-belangrijk-is-het   \",\"description\":\"Winterbanden wisselen; hoe belangrijk is het? \"}'),(654,'8ef31dae-6300-44fb-bc8a-59dd9f1f5ce2',40,'Create','App\\Models\\PageElement',91,'App\\Models\\PageElement',91,'App\\Models\\PageElement',91,'','finished','','2019-10-22 12:44:21','2019-10-22 12:44:21',NULL,'{\"seq\":\"3\",\"title\":\"Regels in het buitenland \",\"content\":\"<div>In Nederland zijn winterbanden niet verplicht, maar in veel andere landen is dit wel het geval. Ook de regels voor het gebruik van sneeuwkettingen verschillen per land. In veel wintersportlanden is een sneeuwketting tijdens en na sneeuwval verplicht. Ook voor campers gelden deze regels. Voor caravans zijn winterbanden niet verplicht maar het verbetert natuurlijk wel de wegligging. Bekijk voor vertrek goed welke regels gelden voor jouw vakantieland.<\\/div>\",\"page_id\":1014,\"updated_at\":\"2019-10-22 14:44:21\",\"created_at\":\"2019-10-22 14:44:21\",\"id\":91}'),(655,'8ef31e6a-4b72-45b1-adeb-4b0ca280bb51',40,'Create','App\\Models\\PageElement',92,'App\\Models\\PageElement',92,'App\\Models\\PageElement',92,'','finished','','2019-10-22 12:46:24','2019-10-22 12:46:24',NULL,'{\"seq\":\"4\",\"title\":\"In de lease \",\"content\":\"<div>Bij Operational Lease hebben berijders de mogelijkheid om winterbanden in het leasecontract op te nemen. Ze krijgen dan een melding wanneer het tijd is om de banden om te wisselen. Voor klanten die een Financial Lease hebben dienen de winterbanden zelf te worden gekocht en gewisseld.&nbsp;<\\/div>\",\"page_id\":1014,\"updated_at\":\"2019-10-22 14:46:24\",\"created_at\":\"2019-10-22 14:46:24\",\"id\":92}'),(656,'8f014e50-3621-407e-88e4-4b5804a58fa6',37,'Create','App\\Models\\Page',1015,'App\\Models\\Page',1015,'App\\Models\\Page',1015,'','finished','','2019-10-29 14:01:56','2019-10-29 14:01:56',NULL,'{\"title\":\"KvK\",\"slug\":\"kvk\",\"description\":\"\",\"template\":\"landingspage\",\"content\":\"<div>hier de content<\\/div>\",\"price\":\"\",\"video_url\":\"\",\"new_type_id\":null,\"vehicle_model_id\":null,\"created_by\":37,\"id\":1015}'),(657,'8f0150d3-898f-4d3c-bada-1f2812017a44',40,'Update','App\\Models\\Page',1015,'App\\Models\\Page',1015,'App\\Models\\Page',1015,'','finished','','2019-10-29 14:08:57','2019-10-29 14:08:57','{\"slug\":\"kvk\",\"content\":\"<div>hier de content<\\/div>\"}','{\"slug\":\"KVK startersdag!\",\"content\":\"<div>Welkom op de pagina van de KVK Startersdag. Wil je gebruik maken van deze speciale actie? Laat dan nu je gegevens achter en we nemen zo snel mogelijk contact met je op!&nbsp;<\\/div>\"}'),(658,'8f0150f1-6857-4515-9bd3-37b332a8a8b3',40,'Update','App\\Models\\Page',1015,'App\\Models\\Page',1015,'App\\Models\\Page',1015,'','finished','','2019-10-29 14:09:17','2019-10-29 14:09:17','{\"slug\":\"KVK startersdag!\",\"description\":\"\"}','{\"slug\":\"kvk\",\"descripti