13:13:45','{\"title\":\"Hoe zit het met de bijtelling in 2018?\",\"content\":\"<div>Hoe zit het met de bijtelling in 2018? De bijtelling in 2018 is onderverdeeld in 4 hoofdcategorie\\u00ebn, waarbij de laagste 4% is en de hoogste 22%. Daar straks meer over, laten we eerst even toelichten wanneer je nou precies bijtelling moet betalen. Bijtelling dien je te betalen wanneer je een auto zakelijk rijdt, maar ook meer dan 500 kilometer per jaar priv\\u00e9 rijdt. De Belastingdienst ziet de auto dan als loon in natura en vindt dat je hier priv\\u00e9 voordeel aan hebt. Daardoor moet er nou eenmaal belasting betaald worden, dit noemt men de fiscale bijtelling. Er wordt een bepaald percentage gerekend (afhankelijk van de auto \\/ uitstoot).<\\/div><div>&nbsp;<\\/div><div>&nbsp;| Bijtelling&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; |&nbsp; Co2 grenzen | 2018<br>&nbsp;| Volledig elektrisch&nbsp; &nbsp; &nbsp;| 0&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; | 4%<br>&nbsp;| Semi elektrisch&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; | 1 \\u2013 50&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; | 22%<br>&nbsp;| Zuinig&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; | 51 \\u2013 106&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; | 22%<br>&nbsp;| Overig&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| &gt; 106&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 22%<br>&nbsp;<\\/div><div>Een aparte categorie zijn de Youngtimers en Oldtimers (voertuigen ouder dan 15 jaar), hier geldt een bijtellingspercentage van 35% van de dagwaarde van het voertuig.&nbsp;<br><br>Voor een fiscaal advies op maat adviseren wij je altijd contact op te laten nemen met je eigen boekhouder of accountant.&nbsp;<\\/div>\",\"template\":null}','{\"title\":\"Hoe zit het met de bijtelling in 2020?\",\"content\":\"<div>Hoe zit het met de bijtelling in 2020? De bijtelling in 2020 is onderverdeeld in 2 hoofdcategorie\\u00ebn, waarbij de laagste 8% is en de hoogste 22%. Daar straks meer over, laten we eerst even toelichten wanneer je nou precies bijtelling moet betalen. Bijtelling dien je te betalen wanneer je een auto zakelijk aanschaft, maar ook meer dan 500 kilometer per jaar priv\\u00e9 rijdt. De Belastingdienst ziet de auto dan als loon in natura en vindt dat je hier priv\\u00e9 voordeel aan hebt. Daardoor moet er nou eenmaal belasting betaald worden, dit noemt men de fiscale bijtelling. Er wordt een bepaald percentage gerekend (afhankelijk van de auto \\/ uitstoot) over de fiscale waarde van de auto.<br><br><\\/div><div>&nbsp;| Bijtelling&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; |&nbsp; Co2 grenzen | 2020<br>&nbsp;| Volledig elektrisch&nbsp; &nbsp; &nbsp;| 0&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; | 8%<br>&nbsp;| Overig&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| &gt; 0&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 22%<br><br><\\/div><div>Let op! Bij volledig elektrische auto\\u2019s met een fiscale waarde boven de \\u20ac45.000 geldt het bijtellingspercentage van 22%. Het bijtellingspercentage van 8% loopt tot en met \\u20ac45.000 en bij alles boven de \\u20ac45.000 betaalt men 22%.<br><br><\\/div><div>De bijtelling wordt bepaald voor 60 maanden na registratie van het voertuig. Na afloop van de periode van 60 maanden wordt het percentage opnieuw vastgesteld aan de hand van de bijtellingsregels op dat moment.<br><br><\\/div><div>Een aparte categorie zijn de Youngtimers en Oldtimers (voertuigen ouder dan 15 jaar), hier geldt een bijtellingspercentage van 35% van de dagwaarde van het voertuig.&nbsp;<br><br><\\/div><div>Voor een fiscaal advies op maat adviseren wij je altijd contact op te nemen met een van onze adviseurs.&nbsp;<br><br><\\/div><div><br><br><\\/div>\",\"template\":\"\"}'),(773,'90de3716-8688-4fbc-a1ff-6762e748